import React, { Component } from 'react';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import { educationGetAction } from '../../actions/education';
import EducationContent from '../../components/educationContent';
import Spinner from '../../components/spinner';

import './style.css';

const Education = () => {
  const educationCardLeft = [
    {
      name: 'BS in Computer Science',
      place: 'unversity of awesomseness',
      period: '2006-2010'
    },
    {
      name: 'Certification in Machine Learning',
      place: 'institute of creativity',
      period: '2011-2012'
    },
    {
      name: 'Certification in Cyber Security',
      place: 'institute of awesomeness',
      period: '2013-2014'
    }
  ];

  const educationCardRight = [
    {
      name: 'MS in Computer Science',
      place: 'unversity of awesomseness',
      period: '2010-2011'
    },
    {
      name: 'Certification in Data Analysis',
      place: 'institute of coolness',
      period: '2012-2013'
    },
    {
      name: 'Certification in Big Data',
      place: 'institute of coolness',
      period: '2014-2015'
    }
  ];

  return (
    <div className="education-layout">
      <EducationContent educations={educationCardLeft} position="left"/>
      <div className="vertical-line"/>
      <EducationContent educations={educationCardRight} position="right"/>
    </div>
  )
};

export default Education;
